import useStyles from './useStyles';
import { DataGrid, GridColumns, GridFilterModel, GridRowData, GridToolbar } from '@material-ui/data-grid';
import { Box } from '@material-ui/core';
import { useState } from 'react';

interface Props {  
    rows: GridRowData[];
    columns: GridColumns;
    newValue?: any
}
export default function DataTable({ rows, columns, newValue }: Props): JSX.Element {
    const classes = useStyles();

    const [filterModel, setFilterModel] = useState<GridFilterModel>({items: [
      {
        columnField: 'pax',
        operatorValue: '>',
        value: '0',
      },
    ],
  });
    return (
      <Box className={classes.root}>
        <DataGrid
          components={{ Toolbar: GridToolbar }}
          componentsProps={{
            panel: {
              sx: {
                '& .MuiTypography-root': {
                  color: 'dodgerblue',
                  fontSize: 20,
                },
                '& .MuiDataGrid-filterForm': {
                  bgcolor: 'lightblue',
                },
              },
            },
          }}
          // filterModel={filterModel}
          // onFilterModelChange={(newFilterModel) => setFilterModel(newFilterModel)}
          rows={rows}
          columns={columns}
          pageSize={10}
          disableSelectionOnClick
          disableColumnMenu={true}
          disableDensitySelector={true}
          classes={{ columnHeader: classes.columnHeader }}
        />
      </Box>
    );
  }
